import React from 'react';
import Indexapp from './components/Indexapp';
import 'bootstrap/dist/css/bootstrap.min.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Newhome from './components/Newhome/Newhome';

function App() {
  return (
    <Router>
    <Switch>
    <Route path="/home">
    <Indexapp />
    </Route>
    <Route path="/Newhome">
    <Newhome />
    </Route>
  </Switch>
</Router>
  );
}

export default App;
